      weatherType: 'Cloudy',
      picture: null,
    },
    {
      id: 7,
      day: 'Saturday',
      weatherType: 'Cloudy',
      picture: null,
    }
  ]
)
  return (
    <div className="container">
      <Header />
      <div className="week">
        <Weekdays weekdays={weekdays} />
      </div>
    </div>
  )
}

export default App;
